import React from 'react';
import styles from './HeaderAnimate.module.css';

const AnimatedHeader = () => {
    return (
        <div id="div">
            <h1 className={styles.h1}>Mad Libs...</h1>
        </div>
    );
};

export default AnimatedHeader;
